INSERT INTO `dias_internacionales` (`id`, `nombre`, `fecha`, `tipo`, `descripcion`) VALUES
(1, 'Día Internacional de la Protección de Datos', '2024-01-28', 1, 'Día dedicado a la concienciación sobre la privacidad y la protección de datos personales.'),
(2, 'Día Internacional del Libro', '2024-04-23', 1, 'Día dedicado a la promoción de la lectura, la publicación de libros y la protección de la propiedad intelectual mediante los derechos de autor. Se pueden promover libros online, ebooks, y fomentar la accesibilidad a la literatura digital.'),
(3, 'Día Mundial de la Propiedad Intelectual', '2024-04-26', 1, 'Día que celebra la importancia de la propiedad intelectual en el fomento de la innovación y la creatividad.'),
(4, 'Día Mundial de las Telecomunicaciones y la Sociedad de la Información', '2024-05-17', 1, 'Día que promueve la importancia de las telecomunicaciones y las tecnologías de la información en la sociedad actual.'),
(5, 'Día Mundial de los Océanos', '2024-06-08', 1, 'Día que incluye la promoción de tecnologías para la protección y conservación marina.'),
(6, 'Día Internacional para la Reducción del Riesgo de Desastres', '2024-10-13', 1, 'Día enfocado en tecnologías para la prevención y respuesta a desastres naturales.'),
(7, 'Día Mundial de la Normalización', '2024-10-14', 1, 'Día que resalta la importancia de los estándares tecnológicos en la industria y la tecnología.'),
(8, 'Día Mundial de la Alimentación', '2024-10-16', 1, 'Día que promueve las tecnologías en la cadena alimentaria para mejorar la seguridad alimentaria.'),
(9, 'Día Internacional para la Erradicación de la Pobreza', '2024-10-17', 1, 'Día que fomenta el uso de tecnologías para el desarrollo y la erradicación de la pobreza.'),
(10, 'Día Mundial de la Ciencia para la Paz y el Desarrollo', '2024-11-10', 1, 'Día que celebra la ciencia y la tecnología como herramientas para la paz y el desarrollo sostenible.'),
(11, 'Día Internacional de la Seguridad Informática', '2024-11-30', 1, 'Día dedicado a la concienciación sobre la importancia de la seguridad en la información y las tecnologías de la información.'),
(12, 'Día Internacional de la Mujer', '2024-03-08', 2, 'Día que celebra los logros sociales, económicos, culturales y políticos de las mujeres y promueve la igualdad de género.'),
(13, 'Día Mundial del Agua', '2024-03-22', 2, 'Día dedicado a la importancia del agua dulce y la gestión sostenible de los recursos de agua dulce.'),
(14, 'Día Mundial del Medio Ambiente', '2024-06-05', 2, 'Día que fomenta la conciencia y la acción global en favor de la protección del medio ambiente.'),
(15, 'Día de los Enamorados o Día de San Valentín', '2024-02-14', 2, 'Día en el que se celebra el amor y el afecto entre parejas y amigos.'),
(16, 'Día Mundial de la Salud', '2024-04-07', 2, 'Día que celebra la salud mundial y promueve la concienciación sobre los temas de salud globales.'),
(17, 'Día Mundial del Perro', '2024-07-21', 2, 'Día dedicado a celebrar a los perros y promover el bienestar y la adopción responsable.'),
(18, 'Día Mundial contra el Cáncer', '2024-02-04', 2, 'Día que promueve la concienciación y la educación sobre el cáncer.'),
(19, 'Día Internacional de la Lucha contra el Cáncer de Mama', '2024-10-19', 2, 'Día que promueve la concienciación y la prevención del cáncer de mama.'),
(20, 'Día Mundial sin Tabaco', '2024-05-31', 2, 'Día dedicado a resaltar los riesgos del consumo de tabaco y promover políticas eficaces para reducir su consumo.'),
(21, 'Día de las Naciones Unidas', '2024-10-24', 2, 'Día que marca el aniversario de la entrada en vigor de la Carta de las Naciones Unidas en 1945.'),
(22, 'Día Internacional de la Felicidad', '2024-03-20', 2, 'Día que reconoce la relevancia de la felicidad y el bienestar como aspiraciones universales de los seres humanos.');
